import React from "react";
import { Link } from "react-router-dom";

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <nav>
        <ul>
          <li>
            <Link to="/audiences">Manage Audiences</Link>
          </li>
          <li>
            <Link to="/campaigns">Manage Campaigns</Link>
          </li>
          <li>
            <Link to="/send-messages">Send Messages</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Dashboard;
